// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Presale is Ownable, ReentrancyGuard {
    // Constants
    uint256 public constant TOKEN_PRICE = 0.01 ether; // 1 MATIC = 100 IMALI
    uint256 public constant HARD_CAP = 1000 ether;
    uint256 public constant SOFT_CAP = 500 ether;
    uint256 public constant MAX_CONTRIBUTION = 10 ether;
    uint256 public constant REFERRAL_BONUS = 500; // 5% (500 basis points)
    uint256 public constant REFUND_CLAIM_PERIOD = 7 days;
    uint256 public constant OWNER_WITHDRAWAL_DELAY = 14 days;

    // State variables
    IERC20 public immutable imaliToken;
    uint256 public presaleEndTime;
    uint256 public totalRaised;
    uint256 public totalReferralEarnings;
    bool public emergencyStop;

    // Mappings
    mapping(address => uint256) public contributions;
    mapping(address => uint256) public claimed;
    mapping(address => address) public referrers;
    mapping(address => uint256) public referralEarnings;
    mapping(address => bool) public whitelist;

    // Events
    event PresaleParticipated(address indexed user, uint256 amount);
    event TokensClaimed(address indexed user, uint256 amount);
    event PresaleRefunded(address indexed user, uint256 amount);
    event PresaleCompleted(uint256 totalRaised);
    event ReferralUsed(address indexed user, address indexed referrer, uint256 bonus);
    event WhitelistUpdated(address[] users, bool status);
    event EmergencyStopToggled(bool status);

    constructor(IERC20 _imaliToken, uint256 _presaleDuration) {
        require(address(_imaliToken) != address(0), "Token cannot be zero");
        require(_presaleDuration > 0, "Duration must be > 0");

        imaliToken = _imaliToken;
        presaleEndTime = block.timestamp + _presaleDuration;
    }

    modifier whenNotEmergency() {
        require(!emergencyStop, "Contract is paused");
        _;
    }

  function participate(address referrer) external payable nonReentrant whenNotEmergency {
    require(block.timestamp < presaleEndTime, "Presale has ended");
    require(msg.value > 0, "Contribution must be > 0");
    require(msg.value <= MAX_CONTRIBUTION, "Exceeds max contribution");
    require(totalRaised + msg.value <= HARD_CAP, "Hard cap reached");
    require(whitelist[msg.sender] || msg.sender == owner(), "Not whitelisted");

    // Handle referral if applicable
    uint256 bonus = 0;
    if (referrer != address(0)) {  // Fixed: Added missing parenthesis
        require(referrer != msg.sender, "Cannot refer self");
        if (referrers[msg.sender] == address(0)) {
            referrers[msg.sender] = referrer;
        }

        address actualReferrer = referrers[msg.sender];
        if (actualReferrer != address(0)) {
            bonus = (msg.value * REFERRAL_BONUS) / 10000;
            referralEarnings[actualReferrer] += bonus;
            totalReferralEarnings += bonus;
            emit ReferralUsed(msg.sender, actualReferrer, bonus);
        }
    }

    uint256 netAmount = msg.value - bonus;
    contributions[msg.sender] += netAmount;
    totalRaised += netAmount;

    emit PresaleParticipated(msg.sender, netAmount);
}

    function claimTokens() external nonReentrant {
        require(block.timestamp >= presaleEndTime, "Presale not ended");
        require(totalRaised >= SOFT_CAP, "Soft cap not met");

        uint256 contribution = contributions[msg.sender];
        require(contribution > 0, "No contribution");
        require(contribution > claimed[msg.sender], "Already claimed");

        uint256 tokenAmount = (contribution * 1e18) / TOKEN_PRICE;
        claimed[msg.sender] = contribution;

        require(imaliToken.transfer(msg.sender, tokenAmount), "Transfer failed");
        emit TokensClaimed(msg.sender, tokenAmount);
    }

    function claimRefund() external nonReentrant {
        require(block.timestamp >= presaleEndTime, "Presale not ended");
        require(block.timestamp < presaleEndTime + REFUND_CLAIM_PERIOD, "Refund period expired");
        require(totalRaised < SOFT_CAP, "Soft cap met");

        uint256 amount = contributions[msg.sender];
        require(amount > 0, "No contribution to refund");

        contributions[msg.sender] = 0;
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Transfer failed");
        emit PresaleRefunded(msg.sender, amount);
    }

    function withdrawReferralEarnings() external nonReentrant {
        uint256 amount = referralEarnings[msg.sender];
        require(amount > 0, "No earnings");

        referralEarnings[msg.sender] = 0;
        totalReferralEarnings -= amount;

        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Transfer failed");
    }

    function completePresale() external onlyOwner nonReentrant {
        require(block.timestamp >= presaleEndTime, "Presale not ended");
        require(totalRaised >= SOFT_CAP, "Soft cap not met");

        uint256 tokensToDistribute = (totalRaised * 1e18) / TOKEN_PRICE;
        require(
            imaliToken.transferFrom(owner(), address(this), tokensToDistribute),
            "Token transfer failed"
        );

        emit PresaleCompleted(totalRaised);
    }

    function withdrawFunds() external onlyOwner nonReentrant {
        require(block.timestamp >= presaleEndTime + OWNER_WITHDRAWAL_DELAY, "Withdrawal too early");
        require(totalRaised >= SOFT_CAP, "Soft cap not met");

        uint256 amount = address(this).balance - totalReferralEarnings;
        (bool success, ) = owner().call{value: amount}("");
        require(success, "Transfer failed");
    }

    // Admin functions
    function addToWhitelist(address[] calldata users) external onlyOwner {
        for (uint i = 0; i < users.length; i++) {
            whitelist[users[i]] = true;
        }
        emit WhitelistUpdated(users, true);
    }

    function removeFromWhitelist(address[] calldata users) external onlyOwner {
        for (uint i = 0; i < users.length; i++) {
            whitelist[users[i]] = false;
        }
        emit WhitelistUpdated(users, false);
    }

    function toggleEmergencyStop() external onlyOwner {
        emergencyStop = !emergencyStop;
        emit EmergencyStopToggled(emergencyStop);
    }

    function recoverUnclaimedFunds() external onlyOwner {
        require(block.timestamp >= presaleEndTime + OWNER_WITHDRAWAL_DELAY * 2, "Too early");
        (bool success, ) = owner().call{value: address(this).balance}("");
        require(success, "Transfer failed");
    }

    // View functions
    function getClaimableTokens(address user) external view returns (uint256) {
        if (block.timestamp < presaleEndTime || totalRaised < SOFT_CAP) {
            return 0;
        }
        return (contributions[user] * 1e18) / TOKEN_PRICE;
    }

    function getRefundAmount(address user) external view returns (uint256) {
        if (block.timestamp < presaleEndTime || 
            block.timestamp >= presaleEndTime + REFUND_CLAIM_PERIOD || 
            totalRaised >= SOFT_CAP) {
            return 0;
        }
        return contributions[user];
    }
}

